.tab {
	width: 100%;
	height: 100%;
	border-left: 1px solid #dcdcdc;
	border-bottom: none;
	padding-top: 2 * @setRemPx;

	font-size: 10px;

	.tab_button_normal {
	}
	.tab_button_selected {
		width: 80%;
		height: 8 * @setRemPx;

		border: 1px solid #e0e0e0;
		border-left: none;
		background-color: #fff;
		display: flex;
		justify-content: center;
		align-items: center;

		.tab_button_selected_text {
			width: 100%;
			height: 100%;

			display: flex;
			justify-content: center;
			align-items: center;

			color: #3c9bff;

			line-height: 1.2 * @setRemPx;
			font-size: 1.2 * @setRemPx;
			font-weight: bold;

			text-align: center;
		}
	}
}
.comboBox_panel {
	width: 100%;
	height: 100%;

	.comboBox_container {
		display: flex;
		flex-direction: column;
		justify-content: flex-start;
		align-items: center;
		padding-right: 2.4 * @setRemPx;

		.comboBox_list {
			display: flex;
			flex-direction: column;
			justify-content: flex-start;
			align-items: center;
			width: 100%;

			&:first-child {
				margin-top: 0.6 * @setRemPx;
			}
		}
	}
}

	display: flex;
	flex-direction: column;
}
.smt-preview-header {
	height: 32px;
	display: flex;
	justify-content: space-between;
	.smt-preview-header-left {
		position: relative;
		z-index: 3;
		margin-left: 6px;
		background-color: white;
		display: flex;
		align-items: center;
		.open-editor {
			width: 130px;
			height: 24px;
			line-height: 24px;
			padding: 0 5px;
			margin-right: 6px;
			color: #3399ff;
			font-size: 12px;
			white-space: nowrap;
			border: 1px solid #3399ff;
			border-radius: 3px;
			box-sizing: border-box;
			cursor: pointer;
			display: flex;
			align-items: center;
			img {
				margin-right: 5px;
			}
			&:hover {
				background-color: #e6f7ff;
			}
		}
	}
	.smt-preview-header-center {
		.device-visible-switch {
			line-height: 32px;
			margin-left: 12px;
		}
	}
	.smt-preview-header-right {
		display: flex;
		flex-direction: row;
		text-align: center;
		align-items: center;
		margin-right: 6px;
		.layer-switch {
			margin-left: 30px;
		}
	}
}

.order-title-wrap {
	position: absolute;
	z-index: 2;
	width: 100%;
	height: 32px;
	display: flex;
	justify-content: center;
	.order-title {
		font-size: 16px;
		font-weight: 600;
		// \u8BBE\u7F6E\u6587\u672C\u80FD\u591F\u88AB\u9009\u4E2D\uFF0C\u4EE5\u4FBF\u901A\u8FC7 execCommand('copy') \u590D\u5236\u6587\u672C
		user-select: text;
		cursor: pointer;
		line-height: 32px;
		max-width: calc(100% - 950px);
		white-space: nowrap;
		overflow: hidden;
		text-overflow: ellipsis;
		// #order-id {
		// 	cursor: pointer;
		// }
	}
}

@media screen and (max-width: 1350px) {
	.order-title-wrap {
		width: calc(100% - 475px);
		right: 0;
		.order-title {
			max-width: 95%;
		}
	}
}

			background-color: white;
		}

			display: flex;
			flex-direction: row;
			text-align: center;
			align-items: center;

	height: 32px;

		height: 16px;

	height: 40px;
	width: 100%;
	background-color: #ffffff;
	display: flex;
	align-items: center;
	// box-shadow: 2px 0px 5px #888888;
	border-bottom: 1px solid #d9d9d9;
}

.content {
	flex: 1;
	display: flex;
	flex-direction: row;
	position: relative;
	overflow: hidden;
	border-top: 1px solid #cbcbcb;
	.smt-layout-left {
		position: relative;
		background-color: #ffffff;
		display: flex;
		height: 100%;
		z-index: 99;
		// min-width: 10% !important;
		.left-container {
			// width: 250px;
			flex: 1;
			overflow: hidden !important; // \u4E3A\u8868\u683C\u5BB9\u5668\u6DFB\u52A0\u6EDA\u52A8\u6761\uFF0C\u8868\u683C\u672C\u8EAB\u4E0D\u8981\u6EDA\u52A8\u6761
			height: 100%;
		}
		.smt-lceda-left-cont {
			overflow-y: hidden;
		}
		.left-container-THT {
			overflow-x: hidden;
		}
	}

	.smt-layout-middle {
		flex: auto;
	}
	.smt-layout-middle-welding-tools {
		overflow: hidden;
		flex: 1;
	}

	.smt-layout-right {
		// flex: 1;
		font-size: 0;
		overflow: hidden;
		overflow-x: auto;
		outline: 0;
		// background-color: black;
	}
	.tab_right {
		font-size: 0;
		overflow: hidden;
		overflow-x: hidden;
		outline: 0;
		width: 28px;
		padding: 0;
		border-bottom: 0;
		background-color: #f0f0f0;
	}

	.right-table {
		overflow: auto; // gerber \u8868\u683C\u653E\u5230\u4E86\u53F3\u8FB9\u65F6\uFF0C\u5728\u8868\u683C\u5E95\u90E8\u663E\u793A\u6EDA\u52A8\u6761
	}
}

.footer {
	// background-color: skyblue;
	position: relative;
	display: flex;
	flex-direction: column;
	.footer-container {
		// height: 200px;
		flex: 1;
	}
}

.container {
	background: #ffffff;
	height: 100%;
	display: flex;
	flex-direction: column;
	// font-family: 'Microsoft YaHei', \u5FAE\u8F6F\u96C5\u9ED1;
}

.flex-auto {
	flex: auto;
}

.smt-gerber-layout-right {
	position: relative;
	background-color: #ffffff;
	display: flex;
	height: 100%;
	overflow: auto;
}

.bottom-xy {
	display: flex;
	position: absolute;
	bottom: 0;
	right: 0;
	z-index: 2;
	width: 99%;
	background-color: #e0e0e0;
	height: 25px;
	line-height: 25px;
	font-size: 12px;
}

.bottom-xy p {
	flex: auto;
	text-align: center;
}

.device-info-modal {
	width: 400px;
	min-height: 150px;
	& > div {
		min-height: 150px;
	}
	p {
		// height: 20px;
		line-height: 20px;
		margin-bottom: 16px;
	}
}

.phone_content {
	flex: 1;
	display: flex;
	flex-direction: column;
	position: relative;
	overflow: hidden;
	// border-top: 1px solid #cbcbcb;
}
.smt_layout_bottom {
	position: relative;
	display: flex;
	flex-direction: column;
}

.bottom_container {
	// width: 250px;
	flex: 1;
	overflow: hidden !important;
	height: 100%;
}

	position: fixed !important;
	top: 50%;
	left: 50%;
	min-width: 300px;
	z-index: 2000;
	background-color: #fff;
	border-radius: 2px;
	border: 1px solid #d1d1d1;
	box-shadow: 0px 0px 12px 2px rgba(0, 0, 0, 0.4);
	transform: translate(-50%, calc(-50% - 30px));
	opacity: 1;
	visibility: hidden;
	// transition: 0.24s;

	// animation: eda-modal-hidden .2s forwards;
	.eda-modal-container {
		display: flex;
		border-radius: 2px;
		flex-direction: column;
		height: 100%;
		width: 100%;
		.eda-modal-header {
			position: relative;
			color: rgba(0, 0, 0, 0.85);
			background: #fff;
			border-radius: 2px 2px 0 0;
			padding: 0 20px;
			height: 28px;
			line-height: 28px;
			background-color: #f1f1f1;
			display: flex;
			align-items: center;
			.eda-modal-title {
				font-size: 12px;
				color: #303133;
				flex: 1;
			}
			.eda-icon-close {
				filter: invert(68%) sepia(0%) saturate(3%) hue-rotate(321deg) brightness(90%) contrast(93%);
				background-image: url('@assets/ui/erp/icon_svg/eda-x.svg');
				background-repeat: no-repeat;
				width: 24px;
				height: 24px;
				cursor: pointer;
				position: relative;
				text-align: center;
				left: 6px;
				background-size: 24px 24px;
				cursor: pointer;
				text-align: center;
				line-height: 28px;

				&:hover {
					filter: invert(52%) sepia(11%) saturate(2798%) hue-rotate(171deg) brightness(113%) contrast(107%);
				}
			}
		}
		.eda-modal-body {
			margin-top: 16px;
			flex: 1;
			font-size: 12px;
			// height: auto;
			min-height: 100px;
			box-sizing: content-box;
			padding: 0px 16px 16px 16px;
			&.flex {
				display: flex;
			}
			.icon {
				padding-right: 4px;
				transform: translateY(-1px);
				img {
					width: 20px;
					height: 20px;
				}
			}
		}

		.eda-message-box__btns {
			display: flex;
			flex-direction: row-reverse;
			padding: 0px 16px 16px;
			text-align: right;
		}
		.modal-btn {
			height: 28px;
			width: fit-content;
			margin-left: 8px;
			padding: 0 16px;
			font-size: 12px;
			box-sizing: border-box;
		}
	}
}

.eda-modal-top {
	top: 20%;
	width: 400px;
}

.eda-show {
	visibility: visible;
	opacity: 1;
	transform: translate(-50%, -50%);
	// animation: eda-modal-show .2s forwards;
}
.confirmDisable {
	background-color: #d9d9d9;
	cursor: not-allowed;
	border: 1px solid #d9d9d9;
	&:hover {
		background: #d9d9d9;
	}
}

.modal-btn-cancel-disabled {
	background-color: #d9d9d9;
	cursor: not-allowed;
	border: 1px solid #d9d9d9;
	color: #fff;
	&:hover {
		background: #d9d9d9;
		border-color: #d9d9d9;
	}
}

.confirmLoading {
	position: relative;
	background-color: #41a9ff;
	border-color: #41a9ff;
	&:hover {
		background-color: #41a9ff;
	}
}

.modal-btn-loading-span {
	position: absolute;
	left: 10px;
	display: inline-block;
	width: 18px;
	height: 18px;
	animation: rotation 1.4s linear infinite;
	background-image: url('@/assets/ui/jlcpcb/eda-loading.svg');
	background-size: 100%;
	background-repeat: no-repeat;
	filter: invert(85%) sepia(98%) saturate(16%) hue-rotate(259deg) brightness(105%) contrast(105%);
}

@keyframes rotation {
	0% {
		transform: rotate(0deg);
	}
	100% {
		transform: rotate(360deg);
	}
}

@keyframes eda-overlay-show {
	0% {
		opacity: 0;
	}
	100% {
		opacity: 1;
	}
}
@keyframes eda-overlay-hidden {
	0% {
		opacity: 0;
	}
	100% {
		opacity: 1;
	}
}

@keyframes eda-modal-show {
	0% {
		opacity: 0;
		transform: translateX(-50%) translateY(calc(-50% - 40px));
		visibility: hidden;
	}
	100% {
		opacity: 1;
		transform: translateX(-50%) translateY(-50%);
		visibility: visible;
	}
}
@keyframes eda-modal-hidden {
	0% {
		opacity: 1;
		transform: translateX(-50%) translateY(-50%);
		visibility: visible;
	}
	100% {
		transform: translateX(-50%) translateY(calc(-50% - 40px));
		opacity: 0;
		visibility: hidden;
	}
}

.eda-show.eda-effect-16 ~ .container {
	filter: blur(3px);
}
